import React, { useState } from "react";
import { auth } from "../Firebase";
import { createUserWithEmailAndPassword } from "firebase/auth";
import houseImg from "../assets/loginhome.avif";
import { useNavigate, Link } from "react-router-dom";

const SignupPage = () => {
  const navigate = useNavigate();
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [confirmPassword, setConfirmPassword] = useState("");

  const handleSignup = async (e) => {
    e.preventDefault();
    if (password !== confirmPassword) {
      alert("Passwords do not match!");
      return;
    }
    try {
      const userCredential = await createUserWithEmailAndPassword(auth, email, password);
      const user = userCredential.user;

      // Save to localStorage
      const userData = { uid: user.uid, name, email };
      localStorage.setItem("user", JSON.stringify(userData));

      alert("Account created successfully!");
      navigate("/Home");
    } catch (error) {
      alert(error.message);
    }
  };

  return (
    <div style={{ display: "flex", flexDirection: "column", minHeight: "100vh" }}>
      {/* Navbar */}
      <div style={{
        display: "flex", justifyContent: "space-between", alignItems: "center",
        padding: "10px 20px", borderBottom: "1px solid #ddd", flexWrap: "wrap"
      }}>
        <button onClick={() => navigate("/Home")} style={btnStyleWhite}>Back to Home</button>
        <div style={{ textAlign: "center", fontSize: "20px", fontWeight: "bold" }}>MyApp Title</div>
        <button onClick={() => navigate("/About-us")} style={btnStyleBlue}>About Us</button>
      </div>

      {/* Main Content */}
      <div style={{ display: "flex", flex: 1, flexDirection: "row", flexWrap: "wrap" }}>
        {/* Left Form */}
        <div style={{ flex: "1 1 100%", maxWidth: "500px", padding: "30px", margin: "0 auto" }}>
          <h2>Create Account</h2>
          <form onSubmit={handleSignup} style={formStyle}>
            <label>Full Name</label>
            <input type="text" placeholder="Enter your name" value={name} onChange={(e) => setName(e.target.value)} style={inputStyle} />
            <label>Email Address</label>
            <input type="email" placeholder="Enter your email" value={email} onChange={(e) => setEmail(e.target.value)} style={inputStyle} />
            <label>Password</label>
            <input type="password" placeholder="Enter your password" value={password} onChange={(e) => setPassword(e.target.value)} style={inputStyle} />
            <label>Confirm Password</label>
            <input type="password" placeholder="Confirm your password" value={confirmPassword} onChange={(e) => setConfirmPassword(e.target.value)} style={inputStyle} />
            <button type="submit" style={submitBtn}>Create Account</button>
          </form>
          <div style={{ marginTop: "20px", textAlign: "center" }}>
            Already have an account? <Link style={{ color: "#007bff", marginLeft: "5px" }} to="/Login">Login</Link>
          </div>
        </div>

        {/* Right Image */}
        <div style={{ flex: "1 1 100%", minHeight: "300px" }}>
          <img src={houseImg} alt="House" style={{ width: "100%", height: "100%", objectFit: "cover", maxHeight: "600px" }} />
        </div>
      </div>
    </div>
  );
};

// Styles
const btnStyleWhite = { background: "white", color: "#007bff", border: "1px solid #007bff", padding: "6px 12px", borderRadius: "6px", cursor: "pointer", marginBottom: "8px" };
const btnStyleBlue = { background: "#007bff", color: "white", padding: "6px 12px", borderRadius: "6px", border: "none", cursor: "pointer", marginBottom: "8px" };
const formStyle = { display: "flex", flexDirection: "column", gap: "15px" };
const inputStyle = { padding: "10px", borderRadius: "6px", border: "1px solid #ccc" };
const submitBtn = { background: "#007bff", color: "white", padding: "10px", border: "none", borderRadius: "6px", cursor: "pointer" };

export default SignupPage;
